import React from "react";
import Nav from "./Nav";
import Header from "./Header";
import Footer from "./Footer";
import HomeProjects from "./HomeProjects";
import { Link } from "react-router-dom";
import "../stylesheets/Home.scss";
import Kompass from "../images/Kompass.svg";

export default function Home() {
  return (
    <div className="home--wrapper">
      <div className="coolwall--animation_wrap">
        <div className="footer--img_wrapper">
          <img className="footer--img" src={Kompass} alt="bread projects" />
        </div>
      </div>
      <Nav />
      <Header />
      <HomeProjects />
      <div className="home--showall">
        <Link to="/projects" className="home--showall_link">
          Show all Projects
        </Link>
      </div>
      <Footer />
    </div>
  );
}
